import React, {useState} from 'react'
import {Doughnut} from 'react-chartjs-2'


const Korbitchart = () => {

        const data = {
                labels: [
                        'XRP',
                        'LUNA',
                        'ETH'
                ],
                datasets: [{
                        label: 'MyGraph',
                        data: [1500, 40, 30],
                        backgroundColor: [
                                'rgb(255,99,132)',
                                'rgb(54,99,132)',
                                'rgb(255,99,86)',

                        ],
                        hoverOffset: 4
                }]
        }

        const options = {
                plugins: {
                    title: {
                        display: true,
                        text: 'Doughnut Chart',
                        color:'blue',
                        font: {
                            size:34
                        },
                        padding:{
                            top:30,
                            bottom:30
                        },
                        responsive:true,
                        animation:{
                            animateScale: true,
                                       }
                    }
                }

            }
  return (
    <div><Doughnut data = {data} options = {options}/></div>
  )
}

export default Korbitchart
